import React from 'react';

export default function Resume() {
    return (
        <div className='resume_card'>
            <h1 className='title'>Resume</h1>
            <div className='text'>
                <h5>Throughout my career, I have created and developed great applications with my training from the University of Central Florida.
                    Couple my training with my passion for learning and my consistent growth as a leader, I can work well with any team that I placed on.
                </h5>
            </div>
        </div>
    );
}
